INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 4, 110501, 10021, 0.0, 4, "2030/12/17 14:59:59", 1, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24015);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 1, 110501, 10021, 4.0, 4, "2030/12/17 14:59:59", 2, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24016);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 4, 110501, 10021, 0.0, 4, "2030/12/17 14:59:59", 3, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24017);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 2, 110501, 10021, 5.2, 1, "2030/12/17 14:59:59", 4, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24018);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 6, 110501, 10021, 4.2, 5, "2030/12/17 14:59:59", 5, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24019);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 2, 110501, 10021, 0.0, 2, "2030/12/17 14:59:59", 6, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24020);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 6, 110501, 10021, 6.4, 1, "2030/12/17 14:59:59", 7, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24021);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 2, 110501, 10021, 0.0, 2, "2030/12/17 14:59:59", 8, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24022);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 3, 110501, 10021, 10.08, 6, "2030/12/17 14:59:59", 9, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24023);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 2, 110501, 10021, 5.0, 1, "2030/12/17 14:59:59", 10, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24024);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24, 2, 110501, 10021, 0.0, 2, "2030/12/17 14:59:59", 11, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", "カオリ（サマー）", 0.0, 24025);
